INSERT INTO `e_buyer_surveys` (`id`, `question`, `question_ar`, `question_ur`, `category`, `question_s_en`, `question_s_ar`, `question_s_ur`, `category_s`, `created_at`, `updated_at`) VALUES
(1, 'Email address', 'عنوان البريد الالكترونى ؟', '', 'About your company', 'Name of your business. *', 'رقم التواصل ؟', '', 'Company', NULL, NULL),
(2, 'Contact number', 'رقم التواصل ؟', '', 'About your company', 'Contact number. *', 'اسم عملك؟', '', 'Company', NULL, NULL),
(3, 'Name of your business?', 'اسم عملك؟', '', 'About your company', 'Your job title? *', 'موقع العمل ؟', '', 'Company', NULL, NULL),
(4, 'Business location', 'موقع العمل ؟', '', 'About your company', 'Business location. *', 'المسمى الوظيفي؟', '', 'Company', NULL, NULL),
(5, 'Your job title?', 'المسمى الوظيفي؟', '', 'About your company', 'Business Category. *', 'نوع العمل؟', '', 'Company', NULL, NULL),
(6, 'Business Category. ', 'نوع العمل؟', '', 'About your company', 'Are you interested in increasing your sales? *', 'هل انت مهتم في زيادة مبيعاتك؟', '', 'Sales', NULL, NULL),
(7, 'Is your business a Business to Business or Business to Consumers oriented?', 'هل عملك عبارة عن شركة موجهة إلى شركة أو شركة موجهة للمستهلكين؟', '', 'Supply Chain Management', 'Are you interested in transforming your supply chain management to digital? *', 'هل انت مهتم بتحويل ادارة سلسلة الامداد الى التحول الرقمي ؟', '', 'Sales', NULL, NULL),
(8, 'How many supply chain employees do you have?', 'كم عدد موظفين سلسلة التوريد لديك؟', '', 'Supply Chain Management', 'Are you a manufacturer, an agent or a distributor for a specific product? *', 'هل انت وكيل او موزع لمنتج معين؟', '', 'Sales', NULL, NULL),
(9, 'Are you satisfied with the productivity of your supply chain employees compared to the number?', 'هل أنت راضٍ عن إنتاجية موظفين سلسلة التوريد لديك مقارنة بالعدد؟', '', 'Supply Chain Management', 'How many factories do you have?', 'كم عدد المصانع لديك؟', '', 'Sales', NULL, NULL),
(10, 'If the answer is \"No\", (not satisfied with productivity and number), what is the reason for your dissatisfaction?', 'إذا كانت الإجابة \"لا\" (غير راضٍ عن الإنتاجية والعدد) ، فما سبب عدم رضاك؟', '', 'Supply Chain Management', 'How many employees do you have in your sales team? *', 'كم عدد فريق المبيعات لديك؟', '', 'Sales', NULL, NULL),
(11, 'How easy it is to find employees interested and passionate about supply chain work? (1 is lowest - 5 is highest).', 'ما مدى سهولة العثور على موظفين محترفين و مميزين في العمل في سلاسل الامداد؟  (1 هو الأدنى 5 هو الأعلى)', '', 'Supply Chain Management', 'Are you satisfied with the productivity of your sales force? *', 'هل انت راضٍ عن انتاجية فريق المبيعات لديك؟', '', 'Sales', NULL, NULL),
(12, 'Does your newly hired supply chain staff need a training when they are hired?', 'هل هناك حاجة لتدريب الموظفين الجدد في سلاسل الامداد بعد تعيينهم؟', '', 'Supply Chain Management', 'How easy is it to find qualified and experienced employees in the field of sales? *', 'ما مدى سهولة العثور على موظفين محترفين و مميزين في مجال المبيعات؟ (1 هو الأدنى 10 هو الأعلى)', '', 'Sales', NULL, NULL),
(13, 'Do you train the newly hired supply chain employees, on job, outside training, or do not train them?', 'هل تقوم بتدريب موظفين سلسلة التوريد المعينين حديثًا ، أثناء العمل ، أو التدريب الخارجي ، أو لا تقوم بتدريبهم؟', '', 'Supply Chain Management', 'Does your newly hired sales staff need training after they are hired? *', 'هل هناك حاجة لتدريب الموظفين الجدد بعد تعيينهم؟', '', 'Sales', NULL, NULL),
(14, 'What is your level of satisfaction with managing supply chains? (1 is lowest - 5 is highest).', 'ما هو مستوى رضاك ​​عن إدارة سلاسل التوريد؟ (1 هو الأدنى - 5 هو الأعلى).', '', 'Supply Chain Management', 'Do you train the newly hired employees, on job, outside training, or do not train them? *', 'هل قمت بتدريب موظفين فريق المبيعات لديك قبل تعيينهم؟', '', 'Sales', NULL, NULL),
(15, 'How many warehouses do you have?', 'كم عدد المستودعات لديك؟', '', 'Warehouse info. ', 'How satisfied are you with the performance of your sales team? *', 'ماهو مستوى رضاك عن فريق المبيعات لديك؟ ', '', 'Sales', NULL, NULL),
(16, 'The agreed period for keeping invoices and official documents before they are destroyed?', 'المدة المتفق عليها لحفظ الفواتير والمستندات الرسمية قبل إتلافها؟', '', 'Warehouse info. ', 'What is the most difficult stage in whole of the sales process? *', 'ماهي اصعب مرحلة في اتمام عملية سلسلة البيع الكاملة؟', '', 'Sales', NULL, NULL),
(17, 'Are you getting the required quantity and the right quality of the product for the amount paid?', 'هل تحصل على الكمية المطلوبة والجودة المناسبة للمنتج مقابل المبلغ المدفوع؟', '', 'Products', 'What do you think can work better to increase your sales? *', 'ماهي وجهة نظرك لزيادة المبيعات لديك؟', '', 'Sales', NULL, NULL),
(18, 'Is the search for an alternative product quick and easy?', 'هل البحث عن منتج بديل سريع وسهل؟', '', 'Products', 'How many warehouses do you have? *', 'عدد المستودعات لديك؟', '', 'Storage', NULL, NULL),
(19, 'If not, then what is the difficulty? (If there is no difficulty you may skip to the next question).', 'إذا لم يكن كذلك فما هي الصعوبة؟ (إذا لم تكن هناك صعوبة يمكنك الانتقال إلى السؤال التالي).', '', 'Products', 'What kind of warehouses do you have? *', 'ماهو نوع المستودعات لديك؟', '', 'Storage', NULL, NULL),
(20, 'What is the duration of the request and receipt of the quotation?', 'ما هي مدة الطلب واستلام عرض الأسعار؟', '', 'Products', 'Are you satisfied with the quality of your storage? *', 'هل انت راضٍ عن جودة التخزين لديك؟', '', 'Storage', NULL, NULL),
(21, 'Is there any difficulty in the payment process?', 'هل هناك صعوبة في عملية الدفع؟', '', 'Products', 'Do you have your own storage or is it rented? *', 'هل المخازن لديك مملوكة ام مستأجرة؟', '', 'Storage', NULL, NULL),
(22, 'Are there any delays in receiving shipments?', 'هل هناك أي تأخير في استلام الشحنات؟', '', 'Products', 'How many trucks do you have? *', 'كم عدد الشاحنات لديك؟', '', 'Logistics', NULL, NULL),
(23, 'Are you satisfied with the cost control of your purchases?', 'هل أنت راضٍ عن التحكم في تكلفة مشترياتك؟', '', 'Purchases', 'What kind of trucks do you have?', 'ماهو نوع الشاحنات المستخدمة؟', '', 'Logistics', NULL, NULL),
(24, 'If not, then what is/are the challenges? (If there is no difficulty you may skip to the next question).', 'إذا لم يكن كذلك ، فما هي التحديات إذن؟ (إذا لم تكن هناك صعوبة يمكنك الانتقال إلى السؤال التالي).', '', 'Purchases', 'How many drivers do you have? *', 'كم عدد السائقين لديك؟', '', 'Logistics', NULL, NULL),
(25, 'How many suppliers do you currently have?', 'كم عدد الموردين لديك حاليا؟', '', 'Purchases', 'Do you have a system to track shipments?', 'هل لديك نظام متكامل لتتبع الشحنات؟', '', 'Logistics', NULL, NULL),
(26, 'Are you given the cost or time details of different steps in the supply chain of the products you buy?', 'هل أعطيت تفاصيل التكلفة أو الوقت للخطوات المختلفة في سلسلة التوريد للمنتجات التي تشتريها؟', '', 'Purchases', 'Do you have an integrated system for scheduling deliveries and linking them with drivers? *', 'هل لديك نظام متكامل لجدولة مواعيد التوريد و ربطها مع السائقين؟', '', 'Logistics', NULL, NULL),
(27, 'Can you see the evaluation of your suppliers in the market?', 'هل يمكنك مشاهدة تقييم مورديك في السوق؟', '', 'Purchases', 'What is the biggest difficulty you face in transportation operations? *', 'ماهي اكبر صعوبة تواجهها في عمليات النقل؟', '', 'Logistics', NULL, NULL),
(28, 'How many persons (steps / levels) are involved in the issue of a P.O.?', 'كم عدد الأشخاص (الخطوات / المستويات) المتورطين في إصدار P.O.؟', '', 'Purchases', 'Are you satisfied with your current logistic service? *', 'هل انت راضٍ عن الخدمات اللوجستية لديك؟', '', 'Logistics', NULL, NULL),
(29, 'How much time it takes to issue a P.O. (After approval of the quotation)?', 'كم من الوقت يستغرق إصدار P.O. (بعد الموافقة على الاقتباس)؟', '', 'Purchases', 'If your answer was \"No\", would you like to share the reason?', 'اذا كانت الاجابة لا فما هي المعوقات اللوجستية لديك؟', '', 'Logistics', NULL, NULL),
(30, 'Can you request a visit or samples from your suppliers?', 'هل يمكنك طلب زيارة أو عينات من مورديك؟', '', 'Purchases', 'How many products do you have? *', 'كم عدد المنتجات لديك؟', '', 'Products', NULL, NULL),
(31, 'Are you interested in increasing your customer base or your volume of business?', 'هل أنت مهتم بزيادة قاعدة عملائك أو حجم عملك؟', '', 'The market', 'What kind of products do you have? *', 'ماهو نوع المنتجات لديك؟', '', 'Products', NULL, NULL),
(32, 'Is your customer base increasing in number?', 'هل تتزايد قاعدة عملائك من حيث العدد؟', '', 'The market', 'Is there any difficulty in supplying the required quantities of the products? *', 'هل هناك صعوبة في توفير الكميات للمنتجات المطلوبة؟', '', 'Products', NULL, NULL),
(33, 'Is your volume of business growing?', 'هل حجم عملك ينمو؟', '', 'The market', 'Is there any difficulty in providing samples to the clients? *', 'هل هناك صعوبة في توفير عينات للعملاء؟ ', '', 'Products', NULL, NULL),
(34, 'How your company competes with the changing market demands?', 'كيف تتنافس شركتك مع متطلبات السوق المتغيرة؟', '', 'The market', 'Is there any difficulty for the customers when they search for your new product/s? *', 'هل هناك أي صعوبة بالنسبة للعملاء عند البحث عن منتجك او منتجاتك الجديدة؟', '', 'Products', NULL, NULL),
(35, 'Is your company currently encountering these issues?', 'هل تواجه شركتك حاليًا هذه المشكلات؟', '', 'The market', 'Do you have any plan to add new products? *', 'هل هناك خطة لاضافة منتجات جديدة لديك؟ ', '', 'Products', NULL, NULL),
(36, 'Would you like more information on how to resolve them?', 'هل ترغب في مزيد من المعلومات حول كيفية حلها؟', '', 'The market', 'Do you face any difficulty in finding the raw materials? *', 'هل تواجه أي صعوبة في العثور على المواد الخام؟', '', 'Products', NULL, NULL),
(37, 'Would your business be interested in getting the experience and knowledge of supply chain at a very minimal cost?', 'هل سيكون عملك مهتمًا بالحصول على الخبرة والمعرفة بسلسلة التوريد بأقل تكلفة؟', '', 'The market', 'What are your payment methods and durations? *', 'ماهي طرق الدفع المعتمدة لديك؟', '', 'Finance', NULL, NULL),
(38, 'How you see your business inclined towards the Digital Transformation in the Supply Chain and IOT (Internet of Things)? (1 is least - 5 is most).', 'كيف ترى أن عملك يميل نحو التحول الرقمي في سلسلة التوريد و IOT (إنترنت الأشياء)؟ (1 على الأقل - 5 هو الأكثر).', '', 'The market', 'Are there any difficulties in collecting the late payments? *', 'هل هناك صعوبة في تحصيل المبالغ المتأخرة؟', '', 'Finance', NULL, NULL),
(39, NULL, NULL, '', NULL, 'If your answer is yes, would you like to share the cause?', 'اذا كانت اجابتك (نعم بشكل مستمر او أحياناً) فما هو السبب؟', '', 'Finance', NULL, NULL),
(40, NULL, NULL, '', NULL, 'Do you have a recovery department?', 'هل لديك فريق متخصص في حل مشاكل التحصيل و ادارتها؟', '', 'Finance', NULL, NULL),
(41, NULL, NULL, '', NULL, 'Do you think having a single financial intermediary to link companies is a viable idea? *', 'هل تعتقد ان وجود وسيط مالي واحد للربط بين الشركات هي فكرة قابلة للتنفيذ؟', '', 'Finance', NULL, NULL),
(42, NULL, NULL, '', NULL, 'For how long your company keeps the invoices and official documents before they are destroyed? *', 'المدة المعتمدة لديكم لحفظ الفواتير و المستندات الرسمية قبل اتلافها؟', '', 'Finance', NULL, NULL),
(43, NULL, NULL, '', NULL, 'How much satisfied you are with the performance of your finance department? *', 'هل انت راضٍ عن عمل الادارة المالية لديك؟', '', 'Finance', NULL, NULL),
(44, NULL, NULL, '', NULL, 'Would you like to suggest an other manufacturer / supplier to fill out this questionnaire? Please share their contact/s.', 'هل تقترح منشأة معينة لتعبئة الاستبيان  ', '', 'Finance', NULL, NULL);
