INSERT INTO `f_a_qs` (`id`, `question_en`, `answer_en`, `question_ar`, `answer_ar`, `priority`, `active`, `created_at`, `updated_at`) VALUES
(1, 'Are the registration and Emdad services for free?', 'We have free registration. We also have Basic package for free with limitations. We have Silver and Gold packages with more options and unlimited benefits.', 'هل التسجيل و الخدمات في إمداد مجانية؟', 'التسجيل لدينا مجاني، يوجد أيضا اشتراك أساسي مع إستخدام محدود و اشتراك في باقة فضية وذهبية مع استخدام لا محدود.', '10', '1', NULL, NULL),
(2, 'How do I register on Emdad Platform?', 'We are a B2B solution. So you need to register as a company with scans of some legal documents and business details for Emdad approval. The head of the company would then invite other users and give them related permissions. A detailed video is also available.', 'كيفية التسجيل في إمداد؟', 'نحن منصة بي تو بي، لذا يجب التسجيل لدينا كمنشأة مع تحميل الملفات المهمة كالسجل التجاري و معلومات منشأتك حتى تحصل على حساب لدينا.', '10', '1', NULL, NULL),
(3, 'Where does Emdad store my data?', 'In our database, on our servers.', 'أين تخزن المنصة بياناتي؟', 'في سحابة مرجعية لا يتم ازالتها نهائيا ', '10', '1', NULL, NULL),
(4, 'How safe is my data?', 'It has multi layers of protection. And all of it is not in one place, to increase its security.', 'هل بياناتي بمكان آمن؟', 'نعم. البيانات مسجلة في مكان آمن ', '10', '1', NULL, NULL),
(5, 'How many RFQs and quotation I can make per month?', 'It depends on the type of the package you choose.', 'كم طلب تسعيرة يمكنني طلبها خلال شهر؟', 'يعتمد على الباقة المسجلة لديك.', '10', '1', NULL, NULL),
(6, 'What are the benefits of Basic, Silver and Gold packages?', 'Basic package (Free): 3 RFQs, 2 Quotations, Unlimited orders. Silver Package (): 10 RFQs, 3 Quotations, Unlimited Orders. Gold Package (): Unlimited RFQs, Unlimited Quotations, Unlimited orders. (All Per Day)', 'ما مميزات الباقة الأساسية، الفضية والذهبية؟', 'الباقة الأساسية (مجانية): 3 طلبات تسعير، 2 تسعيرات، طلبات لا محدودة. الباقة الفضية (؟ ريال سعودي): 10 طلبات تسعير، 3 تسعيرات، طلبات لا محدودة. الباقة الذهبية (؟ ريال سعودي): طلبات تسعير لا محدودة، تسعيرات لا محدودة، طلبات لا محدودة.', '10', '1', NULL, NULL),
(7, 'Do you have storage service?', 'We do not own any storage facility but we have our suppliers for this service.', 'هل لديكم خدمة تخزين البضائع؟', 'لا يوجد لدينا خدمة التخزين، لكن يمكننا أن نوفر لكم خدمة التخزين من موردينا.', '10', '1', NULL, NULL),
(8, 'Can we have more than one users to manage one account?', 'Its up to the head of the company to add any number of users and then give them required permissions.', 'هل يمكن لأكثر من موظف بإدارة الحساب؟', 'نعم، يعتمد على صاحب حساب المنشأة اذا أتاح لأكثر  من موظف لإدارة الحساب.', '10', '1', NULL, NULL),
(9, 'What are the Emdad requirements for the buyer registration?', 'We need the color scans of your legal registrations with government bodies, finance and warehouse details.', 'ما هي متطلبات التسجيل للمشتري؟', 'نحتاج صور من الأوراق الرسمية الحكومية مثل السجل التجاري، المعلومات البنكية، معلومات المستودعات.', '10', '1', NULL, NULL),
(10, 'What are the Emdad requirements for the supplier registration?', 'We need the color scans of your legal permits & registrations with government bodies. Logistics and warehouse details.', 'ما هي متطلبات التسجيل للبائع؟', 'نحتاج صور من الأوراق الرسمية الحكومية مثل السجل التجاري، المعلومات البنكية، معلومات المستودعات بالإضافة الى المعلومات اللوجستية.', '10', '1', NULL, NULL),
(11, 'How do I pay?', 'You may choose a number of ways available at the moment. i.e., Mada, Visa, STC pay, PayPal and Bank transfer.', 'كيف يمكنني الدفع في المنصة؟', 'بإمكانك إختيار عدة طرق مثل: مدى، فيزا، اس تي سي باي، بايبال و التحويل البنكي.', '10', '1', NULL, NULL),
(12, 'Can I track my orders?', 'You you will be given a tracking link through which you can track your order with many details.', 'هل بإمكاني تتبع طلباتي؟', 'سنزودك برابط تتبع يمكنك من خلاله تتبع طلباتك بسهولة.', '10', '1', NULL, NULL),
(13, 'How much the shipping would cost?', 'It would be included in the quotation.', 'ما هي تكلفة الشحن؟', 'تكلفة الشحن والتوصيل مشمولة في التسعيرة.', '10', '1', NULL, NULL);
