INSERT INTO `sms_messages` (`id`, `category`, `arabic_message`, `english_message`, `created_at`, `updated_at`) VALUES
(1, 'Welcome', 'مرحباً بك\r\n شكراً لانضمامك معنا في منصة إمداد، وجهتك الأولى لعالم سلاسل الإمداد.', 'Welcome!%0aThank you for choosing Emdad platform to take you through your procurement and supply chain journey.', '2021-05-31 14:02:35', '2021-05-31 15:50:06'),
(2, 'Submission', 'شريكنا العزيز،\r\nتم استلام طلب تسجيل منشأتك بنجاح وهو الآن قيد المراجعة، قد تستغرق عملية المراجعة ٦ أيام عمل، وستتلقى رداً منا فور انتهائها. \r\nشكراً لك', 'شريكنا العزيز،\r\nتم بنجاح قبول طلب تسجيل منشأتك كـ (مشتري) في منصة إمداد، باستطاعتك الآن تسجيل الدخول وبدء رحلتك معنا.', '2021-06-01 15:30:39', '2021-06-01 15:30:39'),
(3, 'Buyer Welcome after Approval', 'شريكنا العزيز،\r\nتم بنجاح قبول طلب تسجيل منشأتك كـ (مشتري) في منصة إمداد، باستطاعتك الآن تسجيل الدخول وبدء رحلتك معنا.\r\n', 'Dear partner,\r\nWe have successfully received your application and it is now under review. This process might take 6 workong days and we will inform you once it is done.\r\nThank you', '2021-06-01 15:31:13', '2021-06-01 15:31:13'),
(4, 'Supplier Welcome after Approval', 'شريكنا العزيز،\r\nتم بنجاح قبول طلب تسجيل منشأتك كـ (مورّد) في منصة إمداد، باستطاعتك الآن تسجيل الدخول وبدء رحلتك معنا.', 'Dear partner,\r\nYour Application as a (Supplier) has been successfully approved. You can now log in and let the journey begin!', '2021-06-01 15:33:38', '2021-06-01 15:33:38'),
(5, 'Emdad-Message on OTP Verification', NULL, '%0a New user {user_name} has registered as {registration_type} %0a Company name: {company_name}%0a Mobile: {mobile}', '2022-01-25 21:26:47', '2022-01-25 21:26:47'),
(6, 'Emdad-Message on OTP to User', 'Thank you for registering on Emdad digital platform. %0aYour one time verification code is: {otp}', 'Thank you for registering on Emdad digital platform. %0aYour one time verification code is: {otp}', '2022-01-25 21:37:01', '2022-01-25 21:37:01'),
(7, 'Send SMS to on New RFQ Item', 'Send SMS to on New RFQ Item', 'RFQ generated Cat: {category_name} - {parent_name} , Brand: {brand} , Desc: {description}  , UOM: {unit_of_measurement}, \r\nSize: {size}, Qty: {qty} , LP: {last_price} SR , DP: {delivery_period} , PM: {payment_mode} , Rem: {remarks}', '2022-01-26 19:27:46', '2022-01-26 19:27:46'),
(8, 'Test Example', 'Test Example', 'Test Example \r\nCheck Return \r\nEnter Second Time', '2022-01-28 00:57:18', '2022-01-28 00:57:18');
